        visited.remove(v)
        return min_cost_to_one[v]
    for i in range(10):
        dfs(i, set())
    total_mp = 0
    for row in wall:
        for digit in row:
            if digit != -1 and digit != 1:
                total_mp += min_cost_to_one[digit]
    return total_mp

